import {GET_LOCATION} from '.././actioncreators/Type'

const initialState = {
    coords: {
        latitude : 0,
        longtitude : 0
    }
}

const location = (state = initialState,action)=>{
    switch(action.type){
        case GET_LOCATION :
            return action.payload
        default :
            return state
    }
}

export default location
